'''Ayesha''' is a [[Group of Advanced Gardeners|gardener]] in [[Al-Kharid]]. She supervises the local [[Farming/Patch locations#Cactus patches|cactus patch]] and will keep any seeds planted there disease-free for a payment of farming produce.

==Shop==
Ayesha also sells basic farming tools, which can be accessed by talking to her and asking ''Can you sell me something?'' It is not an actual shop and it has no set stock; each item has to be bought individually through the dialogue.
